s commitment to transparency in expenditure.\r\n',1391183580,1391183649,1,0,'N;'),(20776,'0582c978-13d7-4f19-bcef-127fa42faca1','',NULL,'Article 4 Directions','article_4_directions','Extents of Article 4 areas in Malvern Hills District Council under the Town and Country Planning Act. The aim of an Article 4 Direction is to encourage the retention of high quality architectural features and to preserve and enhance the character and appearance of the built heritage by restricting permitted development rights.  Supplied from the Local Land Charges register.',1391776873,1393027156,1,0,'N;'),(20778,'05e1ba1e-5c12-49e5-b16a-8eaa2fd0a670','',NULL,'NHS South Reading CCG payments over £25,000','nhs-south-reading-ccg-payments-over-25-000','NHS South Reading CCG payments to suppliers over £25,000',1393247063,1393247255,1,0,'N;'),(20904,'1ab676f2-8ee7-4ebb-bb60-904be8bf92a3','',NULL,'Compulsary Purchase Orders','comp_p_ord','Areas of land that have been acquired using compulsory purchase powers within Malvern HIlls District.  Data supplied from the Local Land Charges Register.',1391774884,1393037122,1,0,'N;'),(20907,'1ba763ac-251d-4519-8ad3-584d104fcb6d','',NULL,'Social Incubator Fund Data – Social Incubator North','sinsif','The data shows incubator and venture level detail about the Social Incubator Fund, a £10m fund administered by BIG, which supports social incubators to help them provide investment and support to early stage social ventures in the UK. The data is available for all live incubators and is updated by the incubators themselves. This data is has been submitted by Social Incubator North.\r\nA data visualisation platform of the Cabinet Office Investment Readiness Programme can be viewed here: http://data.gov.uk/data/viz/investment-readiness-programme ',1391773514,1392459126,1,0,'N;'),(20971,'26c2f8cc-4bee-4148-9ca8-87c49d133895','',NULL,'Social Incubator Fund Data – (Wayra UnLtd)','social-incubator-fund-data-wayra-unltd','The data shows incubator/venture level detail about the Social Incubator Fund, a £10m fund administered by BIG, which supports social incubators to help them provide investment and support to early stage social ventures in the UK. The data is available for all live incubators and is updated by the incubators themselves. This data is has been submitted by Wayra UnLtd. \r\n\r\nA data visualisation platform of the Cabinet Office Investment Readiness Programme can be viewed here: http://data.gov.uk/data/viz/investment-readiness-programme \r\n',1391775968,1391775971,1,0,'N;'),(21052,'3b209ecd-31e8-4a3d-85ba-10be512f0d16','',NULL,'Meusydd Parcio Gwynedd / Gwynedd Car Parks','meusydd-parcio-gwynedd','Meusydd Parcio o dan berchnogaeth Cyngor Gwynedd \r\n\r\nGwynedd Council owned Car Parks\r\n\r\nMwy o fanylion yma: http://inspire.gwynedd.gov.uk\r\n\r\nMore details here: http://inspire.gwynedd.gov.uk',1391617366,1391680122,1,0,'N;'),(21065,'3d475d63-b300-4b6d-8f2c-e3eab4364eaa','',NULL,'Air Quality Monitoring Stations','air-quality-monitoring-stations','Contains details of the location of current and historic automatic Air Quality Monitoring Stations managed by South Cambridgeshire District Council.  Includes details of the pollution particulates monitored at those sites, and the period during which the data has been gathered.\r\nPlease note that the pollution particulate readings taken at these locations can be found by following the links in the Additional Resources section.',1389885786,1390823909,1,0,'N;'),(21171,'4f12fc4a-c058-4f8b-bad3-7f07fce8c860','',NULL,'Malvern Urban Greenspace','mugs','Extents of areas designated Malvern Urban Green Space (MUGS) in Malvern Hills District Council. Comprising part of the Local Plan as published in 2006.  Policy QL2',1391775702,1393076722,1,0,'N;'),(21202,'53bc0ceb-b2f5-4543-beaf-26c9ac45e13d','',NULL,'Ysgolion Gynradd Gwynedd / Gwynedd Primary Schools','ysgolion-gynradd-gwynedd','Ysgolion Gynradd Cyngor Gwynedd\r\n\r\nGwynedd Council\'s Primary Schools\r\n\r\nMwy o fanylion yma: http://inspire.gwynedd.gov.uk\r\n\r\nMore details here: http://inspire.gwynedd.gov.uk',1391618517,1391618672,1,0,'N;'),(21254,'5f3cfe29-ad79-48b4-a90b-ac4774ea1874','',NULL,'Public Rights of Way','public-rights-of-way2','Rights of Way network for Staffordshire',1392019203,1392019203,1,0,'N;'),(21447,'83483742-9191-4257-8245-9b87b9ea40ce','',NULL,'Ysgolion Arbennig Gwynedd / Gwynedd Special Schools','ysgolion-arbennig-gwynedd','Ysgolion Arbennig Gwynedd\r\n\r\nGwynedd Special Schools\r\n\r\nMwy o fanylion yma: http://inspire.gwynedd.gov.uk\r\n\r\nMore details here: http://inspire.gwynedd.gov.uk',1391619409,1391619412,1,0,'N;'),(21524,'8f944121-f0c4-4f34-91b3-4d182bd118ec','',NULL,'Investment and Contract Readiness Fund Data','icrf-data','This data shows investments made by the Investment and Contract Readiness Fund into high growth potential social ventures. The Investment and Contract Readiness Fund pays for business support to help social ventures raise investment of over £500k or win bids to deliver public services contracts valued at over £1m. The data shows: the venture supported, the grant amount, and the postcode where the venture is headquartered. This data is has been submitted by the Social Investment Business Group who manage the fund.\r\nA data visualisation platform of the Cabinet Office Investment Readiness Programme can be viewed here: http://data.gov.uk/data/viz/investment-readiness-programme\r\n',1391689579,1393064461,1,0,'N;'),(21582,'9a08e296-38e5-422e-8cd2-9f4d4a8ea098','',NULL,'NHS Slough CCG payments over £25,000','nhs-slough-ccg-payments-over-25-000','NHS Slough CCG payments to suppliers over £25,000',1390393756,1391093239,1,0,'N;'),(21592,'9b9ef3bf-06e4-4c7c-84d4-098a5c693b41','',NULL,'Section 3 – Mountain, Moor and Heath','section-3-mountain-moor-and-heath1','Defined Section 3 – Mountain, Moor and Heath areas in Brecon Beacons National Park. \n\nSection 3 of the Wildlife and Countryside (Amendment) Act 1985 placed a responsibility on each of the National Parks of England and Wales to prepare a map showing those areas of mountain, moor, heath, woodland, down, cliff or foreshore, the natural beauty of which the Authority considers it is particularly important to conserve.',1391533207,1392810007,1,0,'N;'),(21609,'9d6273a3-8d79-4d3f-8a49-86d2881c6017','',NULL,'Social Incubator Fund Data - BGV','sifbgv','The data shows incubator and venture level detail about the Social Incubator Fund, a £10m fund administered by BIG, which supports social incubators to help them provide investment and support to early stage social ventures in the UK. The data is available for all live incubators and is updated by the incubators themselves. This data is has been submitted by Bethnal Green Ventures. A data visualisation platform of the Cabinet Office Investment Readiness Programme can be viewed here: http://data.gov.uk/data/viz/investment-readiness-programme',1391701788,1391870259,1,0,'N;'),(21710,'ae9f1338-8d25-4cf8-8697-46b80039a97e','',NULL,'Social Incubator Fund Data - Hub Launchpad','social-incubator-fund-data-hub-launchpad','The data shows incubator and venture level detail about the Social Incubator Fund, a £10m fund administered by BIG, which supports social incubators to help them provide investment and support to early stage social ventures in the UK. The data is available for all live incubators and is updated by the incubators themselves. This data is has been submitted by Hub Launchpad.\r\n\r\nA data visualisation platform of the Cabinet Office Investment Readiness Programme can be viewed here: http://data.gov.uk/data/viz/investment-readiness-programme',1391785742,1391795643,1,0,'N;'),(21720,'b066ad32-1cbd-4ec3-9d88-19b0fcc8905c','',NULL,'NHS Windsor,Ascot & Maiedhead CCG payments over £25000','nhs-windsor-ascot-maiedhead-ccg-payments-over-25000','NHS Windsor, Ascot & Maidenhead CCG payments to supplier over £25,000',1391093153,1392997516,1,0,'N;'),(21754,'b61536bd-2b4e-450d-86fe-e6dcac254b04','',NULL,'Walsall CCG >£25k Expenditure','walsall-ccg-25k-expenditure','Walsall CCG - >£25k Expenditure Reports',1391614659,1391614673,1,0,'N;'),(21796,'bc9709a1-c150-4232-afbd-3e34cc1d2221','',NULL,'NHS Bracknell and Ascot CCG payments over £25,000','nhs-bracknell-and-ascot-ccg-payments-over-25-000','NHS Bracknell & Ascot CCG payments to suppliers over £25,000',1390484342,1391093212,1,0,'N;'),(21974,'d910d954-f341-4f5b-884e-a979223e98b9','',NULL,'Ysgolion Uwchradd Gwynedd / Gwynedd Secondary Schools','ysgolion-uwchradd-gwynedd','Ysgolion Uwchradd Gwynedd\r\n\r\nGwynedd\'s Secondary Schools\r\n\r\nMwy o fanylion yma: http://inspire.gwynedd.gov.uk\r\n\r\nMore details here: http://inspire.gwynedd.gov.uk ',1391619068,1391619072,1,0,'N;'),(21980,'da5592b3-94a0-47ed-a879-913670cfbdfa','',NULL,'Open Space Protection','open-space-protection','Extents of Open Space Protection in Malvern Hills District Council area. Comprising part of the Local Plan as published in 2006.',1391777507,1393082595,1,0,'N;'),(22042,'e85cb942-0585-42df-a224-1392a75774a5','',NULL,'National Population Database Northern Ireland','national-population-database-northern-ireland','The National Population Database (NPD) for Northern Ireland is a point-based Geographical Information System (GIS) dataset that combines locational information from Ordnance Survey Northern Ireland (OSNI) with population information about those locations, mainly sourced from Northern Irish government statistics. The points represent individual buildings allowing the NPD NI to provide detailed local analysis for anywhere in Northern Ireland.\nThe Health and Safety Laboratory (HSL) working with Staffordshire University originally created the NPD for Great Britain in 2004 to help its parent organisation, the Health and Safety Executive (HSE), assess the risks to society of major hazard sites e.g. oil refineries, chemical works and gas holders. Of particular interest to HSE were ‘sensitive’ populations e.g. schools and hospitals where the people at those locations may be more vulnerable to harm and potentially harder to evacuate in an emergency. The data for the NPD NI includes residential, schools and colleges, hospitals and workplace layers.\nThe NPD NI was created using various datasets from OSNI and government organisations and contains other intellectual property so is only available under a license and for a fee. Please contact the HSL GIS team if you would like to discuss gaining access to the data.',1393233605,1393233605,1,0,'N;'),(22044,'e8e1d31b-c82e-4b58-8431-a4cb25628d92','',NULL,'Public Rights of Way','public-rights-of-way1','There is an extensive network of public rights of way covering more than 1,980 kilometers (footpaths, bridleways and byways) in the Brecon Beacons National Park; allowing visitors to explore the area not only on foot but also on horseback or by bicycle.',1391533206,1392810006,1,0,'N;'),(22080,'ee874e1a-a314-470f-a216-5a21931fe266','',NULL,'Landscape Character Assessment','landscape-character-assessment','The purpose of the Landscape Character Assessment is to support the Brecon Beacons National Park Authority’s role and that of its partners in managing the landscape of the National Park by way of implementation of the policies in the National Park Management Plan and Local Development Plan. The Landscape Character Assessment will provide the National Park Authority and relevant partners with a tool to identify and address pressures causing landscape change, and specify management guidance to address these likely pressures. Its spatial approach provides a clear geographic reference for landscape character, special qualities and issues across the National Park.\n\nThe Landscape Character Assessment was commissioned by the Brecon Beacons National Park Authority. It has been prepared by Fiona Fyfe Associates, with Julie Martin Associates, Alison Farmer Associates and Countryscape.',1391523603,1392441432,1,0,'N;'),(22099,'f0b833e2-5e93-4910-81ff-74fe0c330b2e','',NULL,'Greater than £25k Expenditure','greater-than-25k-expenditure','Walsall CCG - >£25k expenditure for January 2014',1392632152,1392632155,1,0,'N;'),(22200,'065fc057-2af8-4b52-ba84-1f276e52ec96','',3,'january-2014-financial-transactions-data-walsall-healthcare-nhs-trust','january-2014-financial-transactions-data-walsall-healthcare-nhs-trust','A monthly updated list of all financial transactions spending over £25,000 made by Walsall Healthcare Nhs Trust, as part of the Government\'s commitment to transparency in expenditure.\r\n',1393610940,1393610941,1,0,NULL),(22254,'c20b21e8-0f29-446f-8bca-376a9a3cbea8','',3,'february-2014-financial-transactions-data-walsall-healthcare-nhs-trust','february-2014-financial-transactions-data-walsall-healthcare-nhs-trust','A monthly updated list of all financial transactions spending over £25,000 made by Walsall Healthcare Nhs Trust, as part of the Government\'s commitment to transparency in expenditure.\r\n',1394827928,1394827930,1,0,NULL);
