  KEY `uid` (`uid`),
  KEY `tnid` (`tnid`),
  KEY `translate` (`translate`)
) ENGINE=InnoDB AUTO_INCREMENT=3089 DEFAULT CHARSET=utf8 COMMENT='The base table for nodes.';
