search_form',1,'a:0:{}','a:5:{s:14:\"title_override\";N;s:19:\"title_override_text\";N;s:12:\"content_type\";s:3:\"all\";s:14:\"override_title\";i:0;s:19:\"override_title_text\";s:0:\"\";}','a:0:{}','a:1:{s:8:\"settings\";N;}','a:0:{}','a:0:{}',0,'a:0:{}'),(107,16,'middle','custom','custom',1,'a:0:{}','a:5:{s:11:\"admin_title\";s:0:\"\";s:5:\"title\";s:0:\"\";s:4:\"body\";s:9610:\"<p>1. <a href=\"#q1\">What is the project doing?</a><br>2. <a href=\"q2\">What is the status of this site?</a><br>3. <a href=\"#q3\">Will personal information be at risk?</a><br>4. <a href=\"#q4\">What is a mashup?</a><br>5. <a href=\"#q5\">What is Linked Data and how does it fit into the Semantic Web?</a><br>6. <a href=\"#q6\">How can people submit applications and visualisations?</a><br>7. <a href=\"#q8\">How can people use data.gov.uk?</a><br>8. <a href=\"#q9\">How were the datasets in data.gov.uk selected?</a><br>9. <a href=\"#q10\">Why is a particular dataset not available yet, and when will it be?</a><br>10. <a href=\"#q11\">Why is a particular dataset not available through an API yet, and when will it be?</a><br>11. <a href=\"#q12\">How can people make contact with the project?</a><br>12. <a href=\"#q13\">Is there a place for developers to discuss ideas, applications and using the data?</a><br>13. <a href=\"#q14\">Will more public data become available in the future?</a><br>14. <a href=\"#q15\">What are the commercial use rights if people have commercial ideas?</a><br>15. <a href=\"#q16\">Under what licence is the data available?</a><br>16. <a href=\"#q17\">Are there any “do”s and “don’t”s?</a></p><p>&nbsp;</p><p>&nbsp;</p><h2><a name=\"q1\"><strong>Q. What is the project doing?</strong></a></h2><p>&nbsp;</p><p>A. The government is opening up its data for other people to re-use. This is only about non-personal, non-sensitive data – information like the list of schools, crime rates or the performance of your council.</p><p>To make sure that we do this properly and work with the web, this work is being overseen by the Transparency Board.</p><p>This preview site is the first step in creating a network of re-useable government data.</p><p>&nbsp;</p><h2><a name=\"q2\"><strong>Q. What is the status of this site?</strong></a></h2><p>&nbsp;</p><p>A. Data.gov.uk launched publicly with a beta version in January 2010. Since then we have launched a number of enhancements which you can read about via the blog. Developments are continuing across the site so do check back regularly and of course please tell us what you <a href=\"http://www.data.gov.uk/contact\">think</a></p><p>&nbsp;</p><h2><a name=\"q3\"><strong>Q. Will personal information be at risk?</strong></a></h2><p>&nbsp;</p><p>A. The data we publish here, and on related websites, will not identify or provide ways to identify individuals, unless that information is already published (like head teachers of schools).</p><p>&nbsp;</p><h2><a name=\"q4\"><strong>Q. What is a mashup?</strong></a></h2><p>&nbsp;</p><p>A. A mashup is a web page or, more usually, a web application that combines data or code from two or more sources. It provides information or functionality beyond that designed or envisaged by the original producers of the data. The attraction of data mashing lies in the ease and speed with which new web applications can be launched with limited resources. People also create visualisations – pictures that show the data in clear, imaginative ways and tell a story about the underlying information.</p><p>For example, a mashup combining data sources such as school addresses and school league tables to display the results using a mapping tool could show where high-achieving schools are. This would be of interest to parents of school-age children who are considering moving house.</p><p>We expect that new and exciting mashups will be the main product of collaboration through this website: be inventive and make things.</p><p>&nbsp;</p><h2><a name=\"q5\"></a><a name=\"whatisthesemanticweb\"><strong>Q. What is Linked Data and how does it fit into the Semantic Web?</strong></a></h2><p>&nbsp;</p><p>A. The Semantic Web is an evolution of the World Wide Web that, rather than just linking from one document to another, focuses on their meaning in relation to each other. Linked Data is a set of technologies to achieve this for data, creating a web of data.</p><p>Here is Sir Tim Berners-Lee explaining the Semantic Web at TED this year:</p><p>&nbsp;</p><p>While the technical details are complicated, and very well explained by resources like <a href=\"http://www.jenitennison.com/blog/\">Jeni Tennison’s practitioner’s blog</a> or the <a href=\"http://n2.talis.com/wiki/Main_Page\">Talis platform wiki</a>, the important thing is how it enables people to exchange links to information and the context for that information. For example, you might point to Bartholomew School, and it will have attributes such as “head teacher”, and be part of the collection “All schools in Oxfordshire”.</p><p>&nbsp;</p><h2><a name=\"q6\"><strong>Q. How can people submit applications and visualisations?</strong></a></h2><p>&nbsp;</p><p>A. Go to the <a href=\"/apps/\">Apps page</a>, where you’ll find information on all applications and visualisations that people have submitted so far, a link for submitting your own application and facilities for joining in discussions.</p><p>&nbsp;</p><h2><a name=\"q8\"><strong>Q. How can people use data.gov.uk?</strong></a></h2><p>&nbsp;</p><p>&nbsp;</p><p>A. Data.gov.uk uses a search engine to offer several ways of finding the data you want. You can view all the datasets to see everything that is currently available, or search by keyword, category or department / agency. Each dataset provides guidance on accessing its data.&nbsp;</p><p>&nbsp;</p><h2><a name=\"q9\"><strong>Q. How were the datasets in data.gov.uk selected?</strong></a></h2><p>&nbsp;</p><p>A. Excluding personal and sensitive information, all information created by public sector bodies is, in principle, available for re-use. In the past, different approaches were adopted by local and regional authorities and individual agencies. The government is now widely encouraging all previously inaccessible public information to be made accessible through this website. For more details on what is being prioritised you should have a look at the <a href=\"http://data.gov.uk/blog/bringing-national-information-infrastructure-life\">National Information Infrastructure</a>&nbsp;or check the <a href=\"http://data.gov.uk/odug\">data request section</a>&nbsp;of the site.</p><p>&nbsp;</p><h2><a name=\"q10\"><strong>Q. Why is a particular dataset not available yet, and when will it be?</strong></a></h2><p>&nbsp;</p><p>A. Given the vast volumes of data, it will be some time before everything can be made available. If there are particular datasets that you believe should be made available more quickly, please use the <a href=\"http://data.gov.uk/odug\">data request process</a>.</p><p>&nbsp;</p><h2><a name=\"q11\"><strong>Q. Why is a particular dataset not available through an API yet, and when will it be?</strong></a></h2><p>&nbsp;</p><p>A. The W3C guidance on <a href=\"http://www.w3.org/TR/gov-data/\">opening up government data</a> suggests that data should be published in its original raw format so that it’s available for re-use as soon as possible. Over time, we will covert datasets to use Linked Data standards, including access through a SPARQL end-point; this will provide an API for easy re-use. The site does have catalogue (metadata) APIs and more information can be found <a href=\"http://data.gov.uk/data/api\">here</a>.</p><p>&nbsp;</p><h2><strong><a name=\"q12\"><strong>Q. How can people make contact with the project?</strong></a></strong></h2><p>&nbsp;</p><p>A. We will provide developer community members who register through our Google Group with project updates. You can also follow the <a href=\"https://twitter.com/DataGovUK\" target=\"_blank\">project team on Twitter</a> and by reading the&nbsp;<a href=\"/blog/\">blogs page</a>. To keep up with the latest progress and developments, check the posts on the <a href=\"/apps\">apps page</a> and discussion boards.</p><p>&nbsp;</p><h2><strong><a name=\"q13\"><strong>Q. Is there a place for developers to discuss ideas, applications and using of the data?</strong></a></strong></h2><p>&nbsp;</p><p>A. Yes, the <a href=\"/forum/\">Discussion forum</a> is for that purpose. We realise that you’ll want to ask us and each other questions and we’ll try and help as best we can. There is also a wiki where you can work together to share techniques, ideas, problems and tools, using data from the UK Government and other sources to help people understand and get more from their area, issues of interest, and the world we live in.</p><p>&nbsp;</p><h2><strong><a name=\"q14\"><strong>Q. Will more public data become available in the future?</strong></a></strong></h2><p>&nbsp;</p><p>A. Yes, this is just the start. As the project matures, more data will flow on to the site.</p><p>&nbsp;</p><h2><strong><a name=\"q15\"><strong>Q. What are the commercial use rights if people have commercial ideas?</strong></a></strong></h2><p>&nbsp;</p><p>A. The Open Government License enables you to use all our data for commercial purposes. We are delighted that you see a commercial opportunity in using our data.</p><p>&nbsp;</p><h2><strong><a name=\"q16\"><strong>Q. Under what licence is the data available?</strong></a></strong></h2><p>&nbsp;</p><p>A. In general, the data is licensed under the Open Government License. You can read more details on what that means on our <a href=\"/terms-and-conditions/\">licence page</a>.</p><p>&nbsp;</p><h2><strong><a name=\"q17\"><strong>Q. Are there any “do”s and “don’t”s?</strong></a></strong></h2><p>&nbsp;</p><p>A. We have a simple <a href=\"/code-conduct/\">code of conduct</a> relating to your use of the data in your application. It covers how to relate your application data to the data we provide, and simple common-sense usage of the data.</p>\";s:6:\"format\";s:9:\"full_html\";s:10:\"substitute\";b:1;}','a:0:{}','a:1:{s:8:\"settings\";N;}','a:0:{}','a:0:{}',0,'a:0:{}');
