INSERT INTO `taxonomy_term_data` VALUES (1,8,'Aggregated data','A form of anonymisation of unit records involving combinations such that individual details are not disclosed. ','plain_text',0),(2,8,'Anonymisation','The Process of adapting data so that individual people or businesses cannot be identified from it. ','plain_text',0),(3,8,'Application Programming Interface (API)','A specification intended to be used as an interface by software components to communicate with each other. An API may include specifications for routines, data structures, object classes, and variables.','plain_text',0),(4,8,'Attribution licence','A licence that requires that the original source of the licensed material is cited (attributed).','plain_text',0),(5,8,'Authoritative','Able to be trusted as being accurate or true; reliable: e.g. \"clear, authoritative information\". ','plain_text',0),(6,8,'Big data','Datasets that are too awkward to work with using traditional, hands-on database management tools.','plain_text',0),(7,8,'Big data analytics','The process of examining and interrogating big data assets to derive insights of value for decision making.','plain_text',0),(8,8,'Click-use','The online licensing system for Crown and Parliamentary copyright information developed by the Office of Public Sector Information in 2001. Click-Use was replaced by the Open Government Licence and the Open Parliament Licence but remains historically significant.','plain_text',0),(9,8,'Commercial use/re-use','Use that is intended for or directed toward commercial advantage or private monetary compensation.  For the purposes of the UK Government Licensing Framework, \'private monetary compensation\' does not include the exchange of the Information for other copyrighted works by means of digital file-sharing or otherwise provided there is no payment of any monetary compensation in connection with the exchange of the Information.','plain_text',0),(10,8,'Content','Published information','plain_text',0),(11,8,'Copyright','Part of the family of intellectual property rights including trademarks, designs and patents. Copyright applies automatically when a work is created in a material form. Copyright applies to literary works, such as website articles/annual reports; artistic works maps, drawings, paintings and photographs; films; sound recordings and typographical arrangements. The first owner of copyright will normally be the artist/author or organisation that created the work (except for Crown copyright). Copyright subsists in a work regardless of the level of artistic or literary merit. The standard term of copyright is the life of the author plus 70 years.','plain_text',0),(12,8,'Core-reference data','Authoritative or definitive data necessary to use other information, produced by the public sector as a service in itself due to its high importance and value. ','plain_text',0),(13,8,'Costs - Fixed','Costs which do not vary with the level of activity in the short run.','plain_text',0),(14,8,'Costs - Full','The total cost of all the resources used in providing a good or service in any accounting period (usually one year). This will include all direct and indirect costs of producing the output (both cash and non-cash costs), including a full proportional share of overhead costs and any selling and distribution costs, insurance, depreciation, and the cost of capital, and any selling and distribution costs, insurance, depreciation, and the cost of capital, including any appropriate adjustment for expected cost increases.','plain_text',0),(15,8,'Costs - Marginal','The incremental cost of providing one further unit of a good or service.','plain_text',0),(16,8,'Creative Commons','A US non-profit organisation which offers a suite of licences to copyright holders to enable them to license their work. The licences offered are all free and licences offered allow the copyright holder to stipulate the certain conditions on how the work may be re-used.','plain_text',0),(17,8,'Crown Copyright','Crown copyright covers material created by civil servants, ministers and government departments and agencies. It is legally defined under section 163 of the Copyright, Designs and Patents Act 1988 as works made by officers or services of the Crown in the course of their duties. Copyright can also come into Crown ownership by means of an assignment or transfer of the copyright from the legal owner of the copyright to the Crown.','plain_text',0),(18,8,'Data (can be singular or plural in common usage)','Values of qualitative or quantitative variables, belonging to a set of items. Data in computing (or data processing) is often represented by a combination of items organised in rows and multiple variables organised in columns. The terms data, information and knowledge are frequently used for overlapping concepts. The main difference is in the level of abstraction being considered. Data is a broad term, embracing others, but is often the lowest level of abstraction, information is the next level and, finally, knowledge is the highest level. See also Raw data, Derived data, Metadata.','plain_text',0),(19,8,'Data discovery',' The process of finding out what data exists and how it can be accessed.','plain_text',0),(20,8,'Data sharing','The transfer of data between different organisations to achieve an improvement in the efficiency and effectiveness of public service delivery.','plain_text',0),(21,8,'Database rights','An intellectual property right which applies to databases defined by the Copyright and Rights in Databases Regulations 1997 as \'a collection of independent works or materials arranged in a systematic or methodical way and that are individually accessible by electronic or other means\'. Database rights apply only to the collection of works, not to the individual works contained within it. Database right protection lasts for 15 years from when the database was completed but the 15 year period will restart if the database is altered significantly.','plain_text',0),(22,8,'Dataset','A collection of data, usually presented in tabular form, presented either electronically or in other formats.','plain_text',0),(23,8,'De-anonymisation','The process of determining the identity of an individual to whom a pseudonymised dataset relates. ','plain_text',0),(24,8,'Definitive','Of recognized authority or excellence','plain_text',0),(25,8,'Delegations of Authority','Authority granted by the Controller of Her Majesty\'s Stationery Office to Crown bodies enabling them to license the re-use of information which they produce.  Crown bodies with complete delegations to license information include trading funds, however some departments have partial delegations to license the use of particular information. All Crown bodies with delegations of authority are subject to the supervision of the Information Fair Trader Scheme.','plain_text',0),(26,8,'Derived data','A data element adapted from other data elements using a mathematical, logical, or other type of transformation, e.g. arithmetic formula, composition, aggregation. See also Value-added data.','plain_text',0),(27,8,'Digital rights management','A class of access control technologies that are used by hardware manufacturers, publishers, copyrightholders and individuals with the intent to limit the use of digital content and devices after sale.','plain_text',0),(28,8,'Disclosive','Data is potentially disclosive if, despite the removal of obvious identifiers, characteristics of this dataset in isolation or in conjunction with other datasets might lead to identification of the individual to whom a record belongs.','plain_text',0),(29,8,'Document','Any content whatever its medium (written on paper or stored in electronic form or as a sound, visual or audiovisual recording).','plain_text',0),(30,8,'Free at point of use',' Where there is no charge or fee to the end-user for the use or re-use of information.','plain_text',0),(31,8,'Freemium','A business model by which a product or service (typically a digital offering such as software, media, games or web services) is provided free of charge, but a premium is charged for advanced features or functionality','plain_text',0),(32,8,'Geospatial data','Also known as spatial data or geographic information, it is the data or information that identifies the geographic location of features and boundaries on Earth, such as natural or constructed features, oceans, and more. Spatial data is usually stored as coordinates and topology, and is data that can be mapped. ','plain_text',0),(33,8,'Information','Interpretation and analysis of data that when presented in context represents added value, message or meaning. See also Data.','plain_text',0),(34,8,'Information Asset Registers (IAR)','Registers specifically set up to capture and organise metadata about the vast quantities of information held by government departments and agencies. A comprehensive IAR includes databases, old sets of files, recent electronic files, collections of statistics, research and so forth.','plain_text',0),(35,8,'Information Fair Trader Scheme (IFTS)','A scheme to set and assess standards for public sector bodies in allowing the re-use of their information. Any public sector body may apply to become IFTS accredited. However, all Crown bodies that hold a delegation of authority from the Controller of HMSO must become IFTS accredited. ITFS measures members\' performance against the six principles of maximisation, simplicity, transparency, fairness, challenge and innovation.  It considers both the commercial re-use of public sector information and non-commercial citizen access to information.','plain_text',0),(36,8,'Information provider','The person, creator or organisation providing the information for re-use under the Open Government Licence or the Non-Commercial Government Licence.','plain_text',0),(37,8,'Intellectual property (rights)','A set of property rights that grant the right to protect the created materials. Intellectual property rights comprise trade marks, patents, registered designs copyright and database rights.','plain_text',0),(38,8,'Licence (noun)','A legal document giving permission to use information','plain_text',0),(39,8,'License (verb)','The act of giving a formal licence (usually written) authorisation.','plain_text',0),(40,8,'Linked data','The term used to describe the recommended best practice for exposing, sharing and connecting items of data on the semantic web using unique resource identifiers (URIs) and resource description framework (RDF).','plain_text',0),(41,8,'Metadata','Data that describes or defines other data. Anything that users need to know to make proper and correct use of the real data, in terms of reading, processing, interpreting, analysing and presenting the information. Thus metadata includes file descriptions, codebooks, processing details, sample designs, fieldwork reports, conceptual motivations, etc., in other words, anything that might influence the way in which the  information is used.','plain_text',0),(42,8,'Modelled data','Information created by mathematical representation of data relationships; sometimes more reliable and internally consistent than sampled observations. ','plain_text',0),(43,8,'Mosaic/jigsaw effect','The process of combining anonymised data with auxiliary data in order to reconstruct identifiers linking data to the individual it relates to.','plain_text',0),(44,8,'Non-Commercial Government Licence','The Non-Commercial Government Licence offers a legal solution to enable the provision and use of public sector information under a common set of terms and conditions at no charge for Non-Commercial use only. It enables any public sector information holder to make their information available for use and re-use under its terms. The main requirement for re-users is to attribute the information provider and source.','plain_text',0),(45,8,'Non-commercial use','Use that is not intended for or directed toward commercial advantage or private monetary compensation.  For the purposes of the UK Government Licensing Framework, \'private monetary compensation\' does not include the exchange of the Information for other copyrighted works by means of digital file-sharing or otherwise provided there is no payment of any monetary compensation in connection with the exchange of the Information.','plain_text',0),(46,8,'Ontology','Formal representation of knowledge as a set of concepts within a domain, and the relationships among those concepts.','plain_text',0),(47,8,'Open access (academic)','Provision of free access to peer-reviewed academic publications.','plain_text',0),(48,8,'Open data','Data which can be used, re-used and re-distributed freely by anyone - subject only at most to the requirement to attribute and share-alike. There may be some charge, usually no more than the cost of reproduction.','plain_text',0),(49,8,'Open Data Commons','An Open Knowledge Foundation project run by its Advisory Council and like the Foundation is a not-for-profit effort working for the benefit of the general open knowledge community. Open Data Commons is the home of a set of legal \'tools\' to help others provide and use open data.  ','plain_text',0),(50,8,'Open Government Licence (OGL)','The Open Government Licence offers a legal solution to enable the provision and use of public sector information under a common set of terms and conditions. It enables any public sector information holder to make their information available for use and re-use under its terms. The main requirement for re-users is to attribute the Information Provider and source.','plain_text',0),(51,8,'Personal data','As defined by the Data Protection Act 1998, data relating to a specific individual where the individual is identified or identifiable in the hands of a recipient of the data.','plain_text',0),(52,8,'Pseudonymised data','Data relating to a specific individual where the identifiers have been replaced by artificial identifiers to prevent identification of the individual.','plain_text',0),(53,8,'Public domain','Works that are publicly available and in which the intellectual property rights have expired or been waived','plain_text',0),(54,8,'Public sector bodies','State, regional or local authorities, bodies governed by public law and associations formed by one or several such authorities or one or several such bodies governed by public law.','plain_text',0),(55,8,'Public Sector Information (PSI)','The wide range of information that public sector bodies collect, produce, reproduce and disseminate in many areas of activity while accomplishing their institutional tasks.','plain_text',0),(56,8,'Public task','Public task information consists of information that a public sector body must produce, collect or provide to fulfil its core role and functions, whether these duties are statutory in nature or are established through custom and practice. The term ‘public task’ features in the Re-use of Public Sector Information Regulations 2005 (SI 2005 No. 1515) and the INSPIRE Regulations 2009 (SI 2009 No. 3157).','plain_text',0),(57,8,'Raw data ','In the context of PSI, raw data is data collected which has not been subjected to processing or any other manipulation beyond that necessary for its first use. Raw data, i.e. unprocessed data,  is a relative term; data processing commonly occurs by stages, and the \'processed data\' from one stage may be considered the \'raw data\' of the next.','plain_text',0),(58,8,'Re-use (noun/verb)','The use by persons or legal entities of documents held by public sector bodies, for commercial or non-commercial purposes other than the initial purpose within the public task for which the documents were produced. Exchange of documents between public sector bodies purely in pursuit of their public tasks does not constitute re-use. ','plain_text',0),(59,8,'Resource Description Framework (RDF)','RDF, a W3C standard, is the foundation of several technologies for modelling distributed knowledge and is meant to be used as the basis of the Semantic Web','plain_text',0),(60,8,'Sample of Anonymised Records (SARs)','A set of unit records available for research where key information has been removed to ensure anonymity. ','plain_text',0),(61,8,'Semantic Web','A web of data that can be processed directly and indirectly by machines.','plain_text',0),(62,8,'Share-alike licence','A Creative Commons style licence that requires users of a work to provide the content under the same or similar conditions as the original.','plain_text',0),(63,8,'Star rating','In UK Linked Data, a system of ranking data sources that indicates ease of machine readability. APPSI subjective score for quality of a definition (qv).','plain_text',0),(64,8,'Synthetic population','A particular application of simulated data that attempts to generate a complete base micro-view of individual subjects of interest. ','plain_text',0),(65,8,'Taxonomy','The science or technique of classification.','plain_text',0),(66,8,'Third party rights','Information, the rights for which are not owned by the Information Provider or Licensor. ','plain_text',0),(67,8,'Trading Funds','An organisation (either within a government department or forming one) which is largely or wholly financed from commercial revenue generated by its activities. Its Estimate shows its net impact, allowing its income from receipts to be devoted entirely to its business. ','plain_text',0),(68,8,'Uniform Resource Identifier (URI)','A string of characters used to identify a name or a resource over a network (typically the World Wide Web) using specific protocols.','plain_text',0),(69,8,'Uniform Resource Locator (URL)','A type of URI that identifies a resource via a representation of its network location','plain_text',0),(70,8,'Unit records','Individual items of information from surveys or observations that often contain confidential details. ','plain_text',0),(71,8,'Value-added information (or data)','Raw data to which value has been added to enhance and facilitate its use and effectiveness by or for users. Also called derived data.','plain_text',0),(72,1,'Health','','plain_text',0),(73,1,'Environment','','plain_text',1),(74,1,'Education','','plain_text',2),(75,1,'Finance','','plain_text',3),(76,1,'Society','','plain_text',4),(77,1,'Defence','','plain_text',5),(78,1,'Transportation','','plain_text',6),(79,1,'Location','','plain_text',7),(80,1,'Linked data','','plain_text',8),(81,1,'Administration','','plain_text',9),(82,1,'Spending data','','plain_text',10),(83,1,'Government','','plain_text',11),(84,1,'Policy','','plain_text',12),(85,2,'Case study','','plain_text',0),(86,2,'Data strategy','','plain_text',1),(87,2,'Guidance','','plain_text',2),(88,2,'Transparency policy','','plain_text',3),(89,2,'Minutes Transparency Board','','plain_text',4),(90,2,'ODUG Minutes','','plain_text',5),(91,2,'ODUG Papers','','plain_text',6),(92,7,'Data Portal Setup','A place to talk about what issues organisations face when trying to launch a data portal.  Also a place to talk about our guidance pack.','plain_text',0),(93,7,'Food hygiene rating data','A place to talk about the Food Standards Agency\'s UK data and API. The data provides food hygiene ratings given to food businesses.','plain_text',0),(94,7,'Police.uk data','A place to talk about Police.uk, its services and data.','plain_text',1),(95,7,'General discussion','General discussion about data, use of data, openness and transparency','plain_text',2),(96,7,'Using data','Discussions on how to go about using and visualising open data','plain_text',3),(97,7,'Publishing data','Everything on publishing data: tools, ontologies, quite how to create your first RDF, etc','plain_text',4),(98,7,'Tools and Applications','A place to discuss apps, and highlight your newly developed app for feedback','plain_text',5),(99,7,'Team building','a place to find other people interested in helping you develop your open data idea','plain_text',6),(100,7,'Open Data','Mutual support and sharing of good practice around Open Data','plain_text',7),(101,3,'England','','plain_text',0),(102,3,'Northern Ireland','','plain_text',1),(103,3,'Scotland','','plain_text',2),(104,3,'Wales','','plain_text',3),(105,3,'Overseas','','plain_text',4),(106,3,'Global','','plain_text',5),(107,5,'Public sector','','plain_text',0),(108,5,'Private sector','','plain_text',1),(109,5,'Third sector','','plain_text',2),(110,5,'Joint/Partnership','','plain_text',3),(111,5,'Academia','','plain_text',4),(112,5,'Other','','plain_text',5);
